t.add("classroom.expiry_mode_rule_tips", "\u25cf Class expiry setting  <br> 1. The setting item is in\u3010Class basic info\u3011<br> 2. There are 3 choises\u3010effective days\u3011\u3010Expired on\u3011\u3010None\u3011<br> <br> \u25cf The rule of expiry <br> 1. Effective days: From the beginning of the course to the end of the effective days, such as: The effective number of days is 10 days, students  enroll the class, in 2017.3.8 <br> 15:00 , then it expired on : 2017.3.18 15:00<br> 2. Expired on: Whenever you enroll class, if the set effective date is: 2017.3.8 All students are valid for: 2017.3.8 24:00<br> <br> \u25cf To change the rule <br> 1. Unpublished status: All settings will be valid after saving.<br> 2. Published status: Can only update the value of the 'effective days' or the 'Expired on', and it will only affect the students who enrolled after the update.<br> 3. Closed\uff1aCannot update<br> 4. In the student management, you can update the expiry for single student<br>\n<br> \u25cf Handle expiry <br> 1. Effective days: If the class has expired, then send notice to students: The current class has expired, please re-enroll<br> 2. Expired on: If the class has expired, then send notice to students: The current class has expired, and cannot learn  any more.<br> 3. Enter into class course, the notice is the same with that in class.<br> 4. A Notice will be made 10 days before the class expires. Both class and class courses will send notification.<br> 5. After the class expires, every items, except review, is only allowed to view, but not allowed to do any other operations. If any operation happens, it will prompte: The current class has expired. \n", "js", "en");
