t.add("admin.question_bank.manage.model", "<p class=\"question-bank-model-title\"><i class=\"es-icon es-icon-Promote\"><\/i>Structural modification<\/p> <p class=\"question-bank-model-text\">In our new version, the questions and testpapers created in the question bank can be used in all courses.<\/p>\n<p class=\"question-bank-model-title\"><i class=\"es-icon es-icon-manage\"><\/i>New feature : question category<\/p> <p class=\"question-bank-model-text\">You can ues question category to manage the question.<\/p>\n<p class=\"question-bank-model-title\"><i class=\"es-icon es-icon-efficiency\"><\/i>optimize the testpaper creation process<\/p> <p class=\"question-bank-model-text\">You can add different types of question at one operation. And you can select questions through different pages.<\/p>\n<p class=\"question-bank-model-title question-bank-model__special\"><i class=\"es-icon es-icon-Explain\"><\/i>PS<\/p> <p class=\"question-bank-model-text\">The questions and testpapers in the courses are all moved to the question bank now.<\/p>\n", "js", "en");
