t.add("admin.login_connect.other.qq.data_content", "1. Your QQ account open platform certification (personal information) need to reach 75%, then you can create an allpication to enable third-party login;<br>2. You need to fill in the callback address as:<br><a><span class='text-danger'>XXX<\/span>\/login\/bind\/qq\/callback;<span class='text-danger'>XXX <\/span>\/settings\/bind\/qq\/callback<\/a><br>,<span class='text-danger'>XXX<\/span> is your site URL. For example, the Qiqiuyu's callback address is:http:\/\/www.qiqiuyu.com\/login\/bind\/QQ\/callback;http:\/\/www.qiqiuyu.com\/settings<br>\/bind\/QQ\/callback; don't forget the \"www\";<br>3. To enable the QQ Buttons, find the ID and key from your personal information at the open platform, and fill them in the edusoho system to turn on the QQ login. <br> If QQ access audition is failed, prompting \"login button is misplaced\", check the \"system\" and \"user settings\", \"login\" part at EduSoho system, to turn on the third-party login and QQ login.", "js", "en");
